import React from 'react'

function Header() {
  return (
    <header>
        {/* left */}
        <div>
            <img
                src='public/images/W' layout='fill'
            />
            
        </div>

        {/* middle */}
        <div></div>

        {/* right */}
        <div></div>
    </header>
  )
}

export default Header
